import "./Style.css";

function NavbarAdmin() {
  return (
    <nav className="navbar">
      <ul className="navbar-list">
        <a href="/painel">
          <li className="painel-menu-nav">Listar Perfis</li>
        </a>
        <a href="/cadastro">
          <li className="painel-menu-nav">Cadastrar Perfil</li>
        </a>
        <a href="/remove">
          <li className="painel-menu-nav">Repo</li>
        </a>
        <a href="/login">
          <li className="painel-menu-nav">Sair</li>
        </a>
      </ul>
    </nav>
  );
}

export default NavbarAdmin;
